import React from "react";
import Footer from "../Footer";
import QuestionBlock from "./QuestionBlock";

const Content = () => {
  return (
    <div>
      <h3>Multiple Choice Questions</h3>
      <QuestionBlock />
      <Footer/>
    </div>
  );
};

export default Content;
